import { Link } from "react-router-dom";

function PodcastData(props) {

    return <Link to={`/podcastDetail/${props.podCast.collectionId}/episode/${props.podCast.trackId}`}> <ul className="list">
        <li>{props.podCast.trackName}</li>
        <li>{props.date(props.podCast.releaseDate)}</li>
        <li>{props.millisToTime(props.podCast.trackTimeMillis)}</li>
    </ul></Link>
}

export default PodcastData;
